Developing an Operator Plug-In
Principles
You can use either of the following methods to develop an operator plug-in:

Non-intermediate representation （IR） mode

The custom class （for example, the ReductionParser class） inherits the CaffeTVMOpParser base class. The ParseParams and ParseWeights functions are rewritten to map the operator and weight parameters of the Caffe model and custom model.
The custom class （for example, the ReductionBuilder class） inherits the TVMOpBuilder base class. The GetOutputDesc function （used to obtain the output description of the operator） and BuildTvmBinFile function （used to build the binary file of the operator） are rewritten.
Operator registration is completed by calling DOMI_REGISTER_OP.
Figure  1  Schematic diagram of operator plug-in development



IR mode

The custom class （for example, CustomOperator class） inherits the Operator class, calls the Attr function （used to write the attribute value to an offline model）, and rewrites the ParseParams function （used to convert parameters and weights of a Caffe mode and fill the result in the custom class）.
The custom class （for example, caffe_reduction_layerOpBuilder class） inherits the TVMOpBuilder base class and rewrites the GetOutputDesc function （used to obtain the output description of the operator） and BuildTvmBinFile function （used to build the binary file of the operator）.
You can call DOMI_OP_SCHEMA to register the operator parameter specifications, DOMI_REGISTER_CAFFE_PARSER to register the operator parsing function, and DOMI_REGISTER_OP to complete the operator registration.



Developing the Registration Code for an Operator Plug-In
Modify the  Reduction_parser.cpp  file in the operator project file to implement the code development of the plug-in. In this example, the operator plug-in is developed in non-IR mode. For details about the development in IR mode, see  IR Mode.
